// Row.js
import React from 'react';

function Row() {
  return (
    <div className="row">
      <div className="gameInfo"> 
        <span>title</span>
        <span>genre</span>
        <span>releaseDate</span>
        <span>htlb</span>
        <span>timePlayed</span>
        <span>status</span>
      </div>
      <span>score</span>
    </div>
  );
}

export default Row;
